		((stream->md_len + md_len - si.main_data_begin <= (511 + 2048 + 8)) ? (void) (0) : __assert_fail("stream->md_len + md_len - si.main_data_begin <= (511 + 2048 + 8)", "layer3.c", 2437, __PRETTY_FUNCTION__));
